import React from 'react';


const Header = () => {

  return (
    // <header className="header">
    //   <div className="page_title">
    //   <h1>Daniel Bradley</h1>
    //   </div>
    //   <div class="container">
    //     <nav class="navbar navbar-collapse navbar-light">
    //         <div className="container-fluid d-flex justify-content-end">
    //             <a className="navbar-brand" href="/about">About</a>
    //             <a className="navbar-brand" href="/portfolio">Portfolio</a>
    //             <a className="navbar-brand" href="/resume">Resume</a>
    //             <a className="navbar-brand" href="/contact">Contact</a>
    //         </div>
    //     </nav>
    // </div>
    // </header>
    <header id="header" class="hoc clear">
      <div id="logo" class="fl_left"> 

        <h1><a href="index.html">Nocobot</a></h1>

      </div>
      <nav id="mainav" class="fl_right"> 

        <ul class="clear">
          <li class="active"><a href="index.html">Home</a></li>
          <li><a class="drop" href="#">Pages</a>
            <ul>
              <li><a href="pages/gallery.html">Gallery</a></li>
              <li><a href="pages/full-width.html">Full Width</a></li>
              <li><a href="pages/sidebar-left.html">Sidebar Left</a></li>
              <li><a href="pages/sidebar-right.html">Sidebar Right</a></li>
              <li><a href="pages/basic-grid.html">Basic Grid</a></li>
              <li><a href="pages/font-icons.html">Font Icons</a></li>
            </ul>
          </li>
          <li><a class="drop" href="#">Dropdown</a>
            <ul>
              <li><a href="#">Level 2</a></li>
              <li><a class="drop" href="#">Level 2 + Drop</a>
                <ul>
                  <li><a href="#">Level 3</a></li>
                  <li><a href="#">Level 3</a></li>
                  <li><a href="#">Level 3</a></li>
                </ul>
              </li>
              <li><a href="#">Level 2</a></li>
            </ul>
          </li>
          <li><a href="#">Link Text</a></li>
          <li><a href="#">Link Text</a></li>
          <li><a href="#">Link Text</a></li>
        </ul>

      </nav>
    </header>
  );
};



export default Header;
